import React, { Component } from 'react'
import { Link } from "react-router-dom";

const navBarView = () => {
    return (
      <div>
        <Link to="/campuses">Campuses</Link> 
        <Link to="/students">Students</Link>
      </div>
    )
  }

export default navBarView;
